    "Survey of furbearer populations on the Yukon Flats National Wildlife Refuge: Study
    plan",nt"tracking_summary": {ntt"total": 1,ntt"recent": 1nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:01:54.105611",nt"name":
    "survey-of-furbearer-populations-on-the-yukon-flats-national-wildlife-refuge-study-plan",nt"isopen":
    false,nt"url": null,nt"notes": "Red fox (Vulpes vulpes), marten (Martes
    americana), and lynx (Lynx canadensis) have been identified by the USFWS as three
    of the most economically important furbearers on the YFNWR. Essential to the sound
    management of these species is information on their distributions, relative abundances,
    and general habitat relationships; the concurrent development of methods to gather
    and accurately assess such information is required. To meet these needs, the USFWS
    and the ADF&G have established a Cooperative Agreement (No. 14-16-0007-84-7416)
    whereby the USFWS will support the ADF&G to conduct a survey of furbearer populations
    on the YFNWR.",nt"license_title": "License Not Specified",nt"extras":
